const HlBAternative = () => {
  return (
    <div className='timelinefor2022intakesmaindiv'>
      <div className="h1balternativecomponents">
        {" "}
        <div className='timelinefor2022intakesimgdiv'> <a href='/h1balternative'> <img className='h1balternativeimg' src={H1Bvisa} width="320px" height="274px" ></img></a></div>
        <p className="h1balternativeone">H1B Alternative</p>
        <p className='h1balternativetwo'>Get your Intership in USA </p>
      </div>
    </div>
  );
};

